import React from "react";
import siteData from "../siteData";

export default function Footer() {
  const [p1, p2] = siteData.phones;

  return (
    <footer className="bg-green-900 text-white mt-20">
      <div className="max-w-6xl mx-auto px-6 py-12 text-center space-y-6">
        {/* Address */}
        <p className="text-sm opacity-90">{siteData.addressText}</p>

        {/* Map */}
        <p>
          üìç{" "}
          <a
            href={siteData.mapLink}
            target="_blank"
            rel="noreferrer"
            className="underline decoration-pink-400 underline-offset-4 hover:text-pink-300 transition"
          >
            View on Google Maps
          </a>
        </p>

        {/* Phones */}
        <p className="space-x-4">
          üìû{" "}
          <a
            href={`tel:${p1}`}
            className="hover:text-yellow-300 transition font-medium"
          >
            {p1}
          </a>
          <span className="opacity-70">|</span>
          <a
            href={`tel:${p2}`}
            className="hover:text-yellow-300 transition font-medium"
          >
            {p2}
          </a>
        </p>

        {/* Instagram */}
        <p>
          üì∑{" "}
          <a
            href={siteData.instagram}
            target="_blank"
            rel="noreferrer"
            className="hover:text-pink-300 transition font-medium"
          >
            Instagram
          </a>
        </p>

        {/* Navigation Links */}
        <div className="flex flex-wrap gap-x-6 gap-y-2 justify-center pt-4 text-sm font-medium">
          {["Home", "About", "Services", "Gallery", "Reviews", "Contact"].map(
            (item) => (
              <a
                key={item}
                href={`#${item.toLowerCase()}`}
                className="hover:text-yellow-300 transition"
              >
                {item}
              </a>
            )
          )}
        </div>

        {/* Copyright */}
        <p className="text-xs opacity-70 pt-4 border-t border-white/20">
          ¬© {new Date().getFullYear()} {siteData.businessName}. All rights reserved.
        </p>
      </div>
    </footer>
  );
}
